import GetDataFeomUser from "./pages/getDataFromUser";


class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            city_list: "",
        }
    }

    render() {
        return (
            <div>

                <Router>


                    <Switch>
                        {/*<Route path={"/MySpace"}>*/}
                        {/*    <MySpace/>*/}
                        {/*</Route>*/}

                        <Route path="/">
                            <GetDataFeomUser/>
                        </Route>

                    </Switch>

                </Router>
            </div>
        );
    }
}
export default App;
